import "./App.css";
import { useState, useEffect } from "react";
import axios from "axios";

function App() {
    const [todos, setTodos] = useState([]);

    useEffect(() => {
        const fetchTodos = async () => {
            const res = await axios.get("http://localhost:8080/data");

            setTodos(res.data.todos);
        };

        fetchTodos();
    }, []);

    console.log(todos);

    return (
        <div className="App">
            <h1>Demo app</h1>
        </div>
    );
}

function List(data) {
    const renderTodos = () => {
        return (
            data.length > 0 &&
            data.map((i) => {
                return <li>{i.title}</li>;
            })
        );
    };

    return <ul>{renderTodos}</ul>;
}

export default App;
